import logo from './logo.svg';
import './App.css';
import Sidebar from "./components/Sidebar";
import NavBar from "./components/NavBar";

function App() {
    return (
        <div className="App">

            <div className="AppSidebar">
                <Sidebar/>
            </div>
            <div className="container">
                <NavBar/>
            </div>

        </div>
    );
}

export default App;
